import React from 'react'
import './Microbotics.css'
import Robotics_1 from './images/Robotics_1.jpg';
import Robotics_2 from './images/Robotics_2.jpg';
import Robotics_3 from './images/Robotics_3.jpg';
import PDF from './files/Microbotics.pdf';
import PPTX from './files/Microbotics.pptx';
import Activity_0 from './files/Activity0.docx';
import Activity_1 from './files/Activity1.docx';
import Activity_2 from './files/Activity2.docx';
import Activity_3 from './files/Activity3.docx';
import Activity_4 from './files/Activity4.docx';
import Activity_5 from './files/Activity5.docx';
import Activity_6 from './files/Activity6.docx';
import Activity_7 from './files/Activity7.docx';

const Microbotics = () => {
  return (
    <div className='microbotics'>
        <div className='content'>
          <h1>2022 Summer Software Workshop</h1>
          <p>In this workshop, we reviewed APS105</p>
          <div className='container'>
            <img className='image1' src={Robotics_1} alt='image1'></img>
            <img className='image2' src={Robotics_2} alt='image2'></img>
            <img className='image3' src={Robotics_3} alt='image3'></img>
          </div>
          <br></br>
          <p id='Download'>Download Lecture Slides
            <a className='dl' href={PDF} download>PDF Format</a>
            <a className='dl' href={PPTX} download>MS PowerPoint Format</a>
          </p>
          <p id='Download2'>Download Activity Sheets
            <a className='dl' href={Activity_0} download>Activity 0</a>
            <a className='dl' href={Activity_1} download>Activity 1</a>
            <a className='dl' href={Activity_2} download>Activity 2</a>
            <a className='dl' href={Activity_3} download>Activity 3</a>
          </p>
          <p id='Download3'>Download Activity Sheets
            <a className='dl' href={Activity_0} download>Activity 0</a>
            <a className='dl' href={Activity_1} download>Activity 1</a>
            <a className='dl' href={Activity_2} download>Activity 2</a>
            <a className='dl' href={Activity_3} download>Activity 3</a>
          </p>
        </div>
    </div>
  )
}

export default Microbotics
